INSERT INTO `fa_cms_page` VALUES (1,0,'page','FastAdmin - 基于ThinkPHP5和Bootstrap的极速后台开发框架','','','','','<p>FastAdmin是一款基于ThinkPHP5+Bootstrap的极速后台开发框架。</p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">主要特性</h2><ul><li><p>基于<code>Auth</code>验证的权限管理系统</p><ul><li>支持无限级父子级权限继承，父级的管理员可任意增删改子级管理员及权限设置</li><li>支持单管理员多角色</li><li>支持管理子级数据或个人数据</li></ul></li><li><p>强大的一键生成功能</p><ul><li>一键生成CRUD,包括控制器、模型、视图、JS、语言包、菜单等</li><li>一键压缩打包JS和CSS文件，一键CDN静态资源部署</li><li>一键生成控制器菜单和规则</li><li>一键生成API接口文档</li></ul></li><li><p>完善的前端功能组件开发</p><ul><li>基于<code>AdminLTE</code>二次开发</li><li>基于<code>Bootstrap</code>开发，自适应手机、平板、PC</li><li>基于<code>RequireJS</code>进行JS模块管理，按需加载</li><li>基于<code>Less</code>进行样式开发</li><li>基于<code>Bower</code>进行前端组件包管理</li></ul></li><li><p>强大的插件扩展功能，在线安装卸载升级插件</p></li><li><p>通用的会员模块和API模块</p></li><li><p>共用同一账号体系的Web端会员中心权限验证和API接口会员权限验证</p></li><li><p>二级域名部署支持，同时域名支持绑定到插件</p></li><li><p>多语言支持，服务端及客户端支持</p></li><li><p>强大的第三方模块支持(<a href=\"https://www.fastadmin.net/store/cms.html\">CMS</a>、<a href=\"https://www.fastadmin.net/store/blog.html\">博客</a>、<a href=\"https://www.fastadmin.net/store/docs.html\">文档生成</a>)</p></li><li><p>整合第三方短信接口(阿里云、腾讯云短信)</p></li><li><p>无缝整合第三方云存储(七牛、阿里云OSS、又拍云)功能</p></li><li><p>第三方富文本编辑器支持(Summernote、Tinymce、百度编辑器)</p></li><li><p>第三方登录(QQ、微信、微博)整合</p></li><li><p>Ucenter整合第三方应用</p></li></ul><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">安装使用</h2><p><a href=\"https://doc.fastadmin.net/\">https://doc.fastadmin.net</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">在线演示</h2><p><a href=\"https://demo.fastadmin.net/\">https://demo.fastadmin.net</a></p><p>用户名：admin</p><p>密&emsp;码：123456</p><p>提&emsp;示：演示站数据无法进行修改，请下载源码安装体验全部功能</p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">界面截图</h2><p><img src=\"https://gitee.com/uploads/images/2017/0411/113717_e99ff3e7_10933.png\" alt=\"控制台\" referrerpolicy=\"no-referrer\" /></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">问题反馈</h2><p>在使用中有任何问题，请使用以下联系方式联系我们</p><p>交流社区:&nbsp;<a href=\"https://forum.fastadmin.net/\">https://forum.fastadmin.net</a></p><p>QQ群:&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=487PNBb\">636393962</a>(满)&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=5ObjtwM\">708784003</a>(满)&nbsp;<a href=\"https://jq.qq.com/?_wv=1027&amp;k=59qjU2P\">964776039</a>(3群)</p><p>Email: (karsonzhang#163.com, 把#换成@)</p><p>Github:&nbsp;<a href=\"https://github.com/karsonzhang/fastadmin\" target=\"_blank\" class=\"url\">https://github.com/karsonzhang/fastadmin</a></p><p>Gitee:&nbsp;<a href=\"https://gitee.com/karson/fastadmin\" target=\"_blank\" class=\"url\">https://gitee.com/karson/fastadmin</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">特别鸣谢</h2><p>感谢以下的项目,排名不分先后</p><p>ThinkPHP：<a href=\"http://www.thinkphp.cn/\">http://www.thinkphp.cn</a></p><p>AdminLTE：<a href=\"https://adminlte.io/\">https://adminlte.io</a></p><p>Bootstrap：<a href=\"http://getbootstrap.com/\">http://getbootstrap.com</a></p><p>jQuery：<a href=\"http://jquery.com/\">http://jquery.com</a></p><p>Bootstrap-table：<a href=\"https://github.com/wenzhixin/bootstrap-table\" target=\"_blank\" class=\"url\">https://github.com/wenzhixin/bootstrap-table</a></p><p>Nice-validator:&nbsp;<a href=\"https://validator.niceue.com/\">https://validator.niceue.com</a></p><p>SelectPage:&nbsp;<a href=\"https://github.com/TerryZ/SelectPage\" target=\"_blank\" class=\"url\">https://github.com/TerryZ/SelectPage</a></p><h2 style=\"font-family:&quot;PingFang SC&quot;;white-space:normal;\">版权信息</h2><p>FastAdmin遵循Apache2开源协议发布，并提供免费使用。</p><p>本项目包含的第三方源码和二进制文件之版权信息另行标注。</p><p>版权所有Copyright &copy; 2017-2018 by FastAdmin (<a href=\"https://www.fastadmin.net/\">https://www.fastadmin.net</a>)</p><p>All rights reserved。</p>','',547,225,0,0,'aboutus','page',1508933935,1553769449,1,'normal');
