INSERT INTO `fa_fyx_notice` VALUES (4,'修复：小几率bug导致图层混乱。动画失效。','Fix: the small probability bug causes the layer confusion. Animation is invalid.\r\n',1531119644),(5,'新增：所有形状默认使用正方形。\r\n','New: all shapes use a square by default.\r\n',1531119654),(6,'新增：公告信息','New: bulletin information',1531119664),(7,'通知：已知一个bug能导致任务一直显示队列中、等待下次出现日志文件再修复。','Notice: a bug is known to cause the task to display the queue and wait for the next log file to be repaired again.\r\n\r\n',1531119941),(8,'通知：充值系统将在本周之内完成。','Notice: the recharge system will be completed within this week.',1531120053),(9,'修复：gif图片过大，导致图片无法解析。','Repair: GIF images are too large to cause images to be parsed.',1531146571),(10,'通知：较大gif图片，呈现部分或全部无法加载。暂时请自行替换。修复作废','Notice: larger GIF images can not be loaded in part or all. Please replace it by yourself for the time being. Repair and invalidate',1531147628),(11,'充值系统日常拖延','The daily delay of the recharge system',1531666913),(12,'修复：部分链接特殊符号导致无法复制。','Repair: partial linking of special symbols causes no replication.\r\n\r\n',1531743856),(13,'新增：在线充值，无需人工审核，即刻到账。','Added: online recharge, no manual audit, immediate arrival.\r\n\r\n',1531743869),(14,'修复：充值系统多次充值的bug','Repair: the bug of the recharge system\r\n\r\n',1531841930),(15,'易企秀平台暂不可用','Eqxiu platform is temporarily unavailable\r\n\r\n',1532230446),(16,'平台无法正常登陆，待修复','The platform cannot be landed properly, and it needs to be repaired.\r\n\r\n',1534217307),(17,'修复：平台现在已正常登陆','Repair: platform is now in normal landing',1534218249),(18,'修复：注销平台账号无法正常显示','Repair: logout account cannot be displayed properly.\r\n\r\n',1534256008),(19,'通知：超强台风\"山竹\"，香港数据中心面临重大挑战，本站服务器就在香港，如遇无法使用敬请谅解','testNotice: the Hong Kong data center is facing a major challenge due to super typhoon \"shanzhu\". The servers of the Hong Kong data center are located in Hong Kong. Please understand if they cannot be used\r\n',1537091222),(20,'通知：如果编辑器空白，请点击保存再刷新即可','Notice: If the editor is blank, please click Save and refresh it.',1560404195);
/*!40000 ALTER TABLE `fa_fyx_notice` ENABLE KEYS */;
